одит потребителям, которые «молоды душой» и постоянно стремятся к совершенству. В линейку продуктов TECNO входят смартфоны, планшеты, интеллектуальные нательные устройства и устройства, где Интернет вещей сочетается с ИИ. Устройства доступны на более чем 70 развивающихся рынках по всему миру.","name":"TECNO","website":"http://ru.tecno-mobile.com","offersCount":16599,"categoriesCount":10,"hasArticle":false}},"userComparisonList":{},"referenceWishlistItem":{}}}</noframes><script id=apiary-marker-2zqg1 nonce="sgfQP9tzc+il7u1uKEXv0Q==">(window.apiaryMarkerPortal=window.apiaryMarkerPortal||[]).push(["@MarketNode/ProductCardTitle","/content/productCardTitle","react",null,"react","apiary-marker-2zqg1","/content/productCardTitle-1",[],true,"@MarketNode/ProductReviewsPage","/content",true,0,null,null,[]]);</script></div></div><div class="tamef _2MOII _1cVMh" data-tid="5b31715"><div class="_16Mpw"><div><!--BEGIN [@MarketNode/ReviewsToolbar] /content/reviewsToolbar--><div class="" data-zone-name="reviews-toolbar"><div class="_3qTpq" data-tid="5fd0fafb"><div class="Y6q-q"><h2 class="_2POmq">Отзывы</h2><div><!--BEGIN [@MarketNode/UgcMediaGallery] /content/reviewsToolbar/ugcMediaGallery--><div class="" data-zone-data="{&quot;productId&quot;:1699577197}" data-zone-name="ugc-media-gallery"><article class="_1PEtM" data-tid="f4b2bfd6"><h3 class="_2Oubu">Фотографии и видео покупателей</h3><div class="_3Oiax _32o4X" data-tid="2b207a8e"><div class="_2v6LD YKKDw" data-tid="c726a6ee"><div class="VFWBy uG_0s" data-auto="scroll-box-viewport"><ul class="_3AmSh _2x9mu _1kuLK brandTheme-default" style="transform:translate3d(0px, 0, 0);transition-duration:0ms;transition-timing-function:ease-in-out"><div data-auto="item" role="" class="_1nO7x uG_0s" data-tid="c726a6ee" data-tid-prop="c726a6ee"><div data-tid="f4b2bfd6" data-tid-prop="f4b2bfd6" class="cia-cs" data-zone-data="{&quot;productId&quot;:&quot;1699577197&quot;}" data-zone-name="addMediaButton"><button class="_1KpjX _3TWM2" aria-label="До